import { Link } from "react-router-dom"
import { useLocation } from "react-router-dom"
import data from "../../data.json"

export default function BoardList (){

    const Location = useLocation();
    const secondLocation = Location.pathname.split('/')[2]
    const DATA = data[secondLocation];

    console.log(secondLocation);

    return (
        <>
        <ul className="boardList">
            <li><span>구분</span><p>제목</p><span>작성일</span><span>조회수</span></li>
            <ol>
                {DATA.map((el,index) => <li key={index}><Link><span>{el.type}</span><p>{el.title}</p><span>{el.date}</span>{el.views}</Link></li>)}
            </ol>
        </ul>
        </>
    )
}
